import { Container, Row, Col } from 'react-bootstrap';
import '../static/css/bootstrap.min.css';

const Header = () => {
    return(
        <React.Fragment>
            <h2></h2>
            <Container>
                <Row>
                    <Col>Left</Col>
                    <Col>Center</Col>
                    <Col>Right</Col>
                </Row>
            </Container>
        </React.Fragment>
    )
}

export default Header;
